script: |
  super -f text -I q12337.spq | sort > q12337.out

inputs:
  - name: q12337.spq
    data: |
      SELECT DISTINCT + col1 * - col0 AS col0 FROM tab1 (FORMAT parquet) WHERE NOT + + col1 BETWEEN - - col0 AND + - col1;
  - name: tab1

outputs:
  - name: q12337.out
    data: |
      -425
      -4277
      -714
